import Navbar from "./Navbar";

const Home = () => {
    return ( 
        <div className="bg-green-300 text-white relative bg-contain h-screen w-screen flex justify-center items-center text-5xl">
        <h1><a href="#About">Alex Nham</a></h1>
        <a className="absolute top-0 " id="Home"></a>
        <Navbar/>
      </div>
     );
}

export default Home;
